const getTrashData = async () => {
    try {
      const response = await fetch(
        'https://api-dev-plastico.westeurope.cloudapp.azure.com/v1/geojson/-2.0/43.0/-1.0/44.0?entity_type=trash'
      );
      const data = await response.json();
      return data;
    } catch (error) {
      console.error(error);
      return error;
    }
  };
  
  export default getTrashData;
